static Fl_Image *image_stygmicon128() {
  static Fl_Image *image = new Fl_Pixmap(idata_stygmicon128);
  return image;
}

void about::cb_Close_i(Fl_Button*, void*) {
  aboutwin->do_callback();
}
void about::cb_Close(Fl_Button* o, void* v) {
  ((about*)(o->parent()->user_data()))->cb_Close_i(o,v);
}

about::about() {
  Fl::visual(FL_DOUBLE|FL_INDEX);
  Fl::visual(FL_RGB);
  
  static const char *pepe [] ={"stygmorgan"};
  char temp[64];
  int argc=1;
  char **argv= (char **) pepe;
  
  make_window();
  aboutwin->position(x+100,y+160);
  bzero(temp,sizeof(temp));
  sprintf(temp, "About %s",PACKAGE);
  
  aboutwin->copy_label(temp);
  aboutwin->icon((char *)p);
  aboutwin->show(argc,argv);
  
  bzero(temp,sizeof(temp));
  sprintf(temp, "%s %s",PACKAGE,VERSION);
  progname->copy_label(temp);
  
  Fl_Text_Buffer *buf = new Fl_Text_Buffer(2000);
  Fl_Text_Buffer *buf1 = new Fl_Text_Buffer(20000);
  Fl_Text_Buffer *buf2 = new Fl_Text_Buffer(1000);
  Fl_Text_Buffer *buf3 = new Fl_Text_Buffer(1000);
  Fl_Text_Buffer *buf4 = new Fl_Text_Buffer(1000);
  
  bzero(temp,sizeof(temp));
  sprintf(temp,"%s/AUTHORS",HELPDIR);
  buf->insertfile(temp,1);
  TDA->buffer(buf);
  
  bzero(temp,sizeof(temp));
  sprintf(temp,"%s/LICENSE",HELPDIR);
  buf1->insertfile(temp,1);
  TDL->buffer(buf1);
  
  bzero(temp,sizeof(temp));
  sprintf(temp,"%s/THANKS",HELPDIR);
  buf2->insertfile(temp,1);
  TDTh->buffer(buf2);
  
  bzero(temp,sizeof(temp));
  sprintf(temp,"%s/DISCLAIMER",HELPDIR);
  buf3->insertfile(temp,1);           
  TDD->buffer(buf3);
  
  bzero(temp,sizeof(temp));
  sprintf(temp,"%s/TRANSLATE",HELPDIR);
  buf4->insertfile(temp,1);
  TDT->buffer(buf4);
}

Fl_Double_Window* about::make_window() {
  { aboutwin = new Fl_Double_Window(625, 370);
    aboutwin->color((Fl_Color)44);
    aboutwin->labelcolor(FL_BACKGROUND2_COLOR);
    aboutwin->callback((Fl_Callback*)cb_aboutwin, (void*)(this));
    { Fl_Tabs* o = new Fl_Tabs(0, 0, 615, 330);
      o->color((Fl_Color)44);
      o->selection_color(FL_DARK1);
      o->labelcolor(FL_BACKGROUND2_COLOR);
      { Tab1 = new Fl_Group(0, 30, 600, 295, gettext("About"));
        Tab1->color((Fl_Color)44);
        Tab1->selection_color(FL_DARK1);
        Tab1->labelcolor(FL_BACKGROUND2_COLOR);
        { progname = new Fl_Box(45, 150, 525, 40);
          progname->labelfont(1);
          progname->labelsize(22);
          progname->align(Fl_Align(FL_ALIGN_CENTER|FL_ALIGN_INSIDE));
        } // Fl_Box* progname
        { new Fl_Box(20, 185, 565, 40, gettext("A Interactive Music Workstation Software"));
        } // Fl_Box* o
        { new Fl_Box(155, 220, 305, 25, gettext("(c) 2006-2009, Josep Andreu"));
        } // Fl_Box* o
        { Fl_Box* o = new Fl_Box(65, 75, 505, 60);
          o->image( image_stygmicon128() );
        } // Fl_Box* o
        Tab1->end();
      } // Fl_Group* Tab1
      { Tab2 = new Fl_Group(0, 30, 615, 300, gettext("Authors"));
        Tab2->color((Fl_Color)44);
        Tab2->selection_color(FL_DARK1);
        Tab2->labelcolor(FL_BACKGROUND2_COLOR);
        Tab2->hide();
        { TDA = new Fl_Text_Display(5, 35, 605, 290);
          TDA->color((Fl_Color)44);
          TDA->selection_color(FL_DARK1);
          TDA->labelcolor(FL_BACKGROUND2_COLOR);
          TDA->textcolor(FL_BACKGROUND2_COLOR);
        } // Fl_Text_Display* TDA
        Tab2->end();
      } // Fl_Group* Tab2
      { Fl_Group* o = new Fl_Group(0, 30, 615, 300, gettext("Thanks to"));
        o->color((Fl_Color)44);
        o->selection_color(FL_DARK1);
        o->labelcolor(FL_BACKGROUND2_COLOR);
        o->hide();
        { TDTh = new Fl_Text_Display(5, 35, 605, 290);
          TDTh->color((Fl_Color)44);
          TDTh->selection_color(FL_DARK1);
          TDTh->labelcolor(FL_BACKGROUND2_COLOR);
          TDTh->textcolor(FL_BACKGROUND2_COLOR);
        } // Fl_Text_Display* TDTh
        o->end();
      } // Fl_Group* o
      { Fl_Group* o = new Fl_Group(0, 30, 615, 300, gettext("Translate"));
        o->color((Fl_Color)44);
        o->selection_color(FL_DARK1);
        o->labelcolor(FL_BACKGROUND2_COLOR);
        o->hide();
        { TDT = new Fl_Text_Display(5, 35, 605, 290);
          TDT->color((Fl_Color)44);
          TDT->selection_color(FL_DARK1);
          TDT->labelcolor(FL_BACKGROUND2_COLOR);
          TDT->textcolor(FL_BACKGROUND2_COLOR);
        } // Fl_Text_Display* TDT
        o->end();
      } // Fl_Group* o
      { Fl_Group* o = new Fl_Group(0, 30, 615, 300, gettext("License"));
        o->color((Fl_Color)44);
        o->selection_color(FL_DARK1);
        o->labelcolor(FL_BACKGROUND2_COLOR);
        o->hide();
        { TDL = new Fl_Text_Display(5, 35, 605, 290);
          TDL->color((Fl_Color)44);
          TDL->selection_color(FL_DARK1);
          TDL->labelcolor(FL_BACKGROUND2_COLOR);
          TDL->textcolor(FL_BACKGROUND2_COLOR);
        } // Fl_Text_Display* TDL
        o->end();
      } // Fl_Group* o
      { Fl_Group* o = new Fl_Group(0, 25, 615, 305, gettext("Disclaimer"));
        o->color((Fl_Color)44);
        o->selection_color(FL_DARK1);
        o->labelcolor(FL_BACKGROUND2_COLOR);
        o->hide();
        { TDD = new Fl_Text_Display(5, 30, 605, 295);
          TDD->color((Fl_Color)44);
          TDD->selection_color(FL_DARK1);
          TDD->labelcolor(FL_BACKGROUND2_COLOR);
          TDD->textcolor(FL_BACKGROUND2_COLOR);
        } // Fl_Text_Display* TDD
        o->end();
      } // Fl_Group* o
      o->end();
    } // Fl_Tabs* o
    { Fl_Button* o = new Fl_Button(530, 340, 85, 25, gettext("Close"));
      o->box(FL_PLASTIC_THIN_UP_BOX);
      o->color((Fl_Color)11);
      o->selection_color((Fl_Color)3);
      o->callback((Fl_Callback*)cb_Close);
    } // Fl_Button* o
    aboutwin->end();
  } // Fl_Double_Window* aboutwin
  return aboutwin;
}
